from musicdb.albumoftheyear import MusicDBParamsdef test_params():    mdbparams = MusicDBParams()    assert mdbparams.db == "AlbumOfTheYear"        assert hasattr(mdbparams, "mediaTypes"), f"mdbparams [{mdbparams}] does not have mediaTypes attr"    assert isinstance(getattr(mdbparams, "mediaTypes"), list), f"mdbparams [{mdbparams}] mediaTypes is not a list"        for pMap in ["parseMap", "concatMap", "mergeMap"]:        assert hasattr(mdbparams, pMap), f"mdbparams [{mdbparams}] does not have {pMap} attr"        assert isinstance(getattr(mdbparams, pMap), dict), f"mdbparams [{mdbparams}] {pMap} is not a dict"            assert hasattr(mdbparams, "mediaRanking"), f"mdbparams [{mdbparams}] does not have mediaRanking attr"    assert isinstance(getattr(mdbparams, "mediaRanking"), dict), f"master [{mdbparams}] mediaRanking is not a dict"